import logo from "../../Assets/Mask Group.svg";
import bag from "../../Assets/bag.svg";
import { useForm, SubmitHandler } from "react-hook-form";

interface ISearch {
  item: string;
}

export const Header = () => {
  const { register, handleSubmit } =
    useForm<ISearch>(/* {
        resolver: yupResolver(formShemaLogin),
      } */);

  const submitSearch: SubmitHandler<ISearch> = (data) => {
    console.log(data);
  };
  return (
    <StyledHeader>
      <StyledCotainerDiv>
        <img src={logo} alt="" />
        <form onSubmit={handleSubmit(submitSearch)}>
          <input {...register("item")} />
          <StyledButton type="submit">Pesquisar</StyledButton>
          {/* <ButtonDefault type="submit" text="Pesquisar" /> */}
        </form>
        <button>
          <img src="" alt="" />
        </button>
      </StyledCotainerDiv>
    </StyledHeader>
  );
};
